import React from 'react'

const Logo = () => {
  return (
    <div id='logo'>
        <img  height={25} src="https://static-assets-web.flixcart.com/fk-p-linchpin-web/fk-cp-zion/img/flipkart-plus_8d85f4.png" alt="" />
     <div id='a2'><li> Explore</li>
     <li id='gold'><b> Plus</b></li>
       <img height={25} src="https://static-assets-web.flixcart.com/fk-p-linchpin-web/fk-cp-zion/img/plus_aef861.png" alt="" />
       </div> 
    </div>
     )
}

export default Logo
